let intro = "I'm Alaaddin, but my friends call me Alaa-- and this is my homepage. There's not much here, but the idea is that this site will grow to flourish over time. I'm a software engineer with an academic background in mechanical engineering. I transitioned into software development a few years ago, and have not looked back. My interests are primarily in learning. I don't always stick to a theme, and I find myself spending hours reading up on topics that don't cross over into my everyday life. I love starting personal projects, and I have yet to feel the joy of completing one. When can a personal project reach a final state anyway? Aren't all things constantly in a state of change. Hopefully this homepage continues to grow with me, and maintains a presentable 'finish'. Thanks for stopping by.";

export function getIntro()
{
    return intro;
}
